import React from "react";
import { Form, Row, Col, Button, Container } from "react-bootstrap";
const FormContainer = ({ children }) => {
  return (
    <>
      <Container>
        <Row>
          <Col xs={12} md={6} className="justify-content-md-center">
            {children}
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default FormContainer;
